using CryptoBase.Abstractions.SymmetricCryptos;
using CryptoBase.BouncyCastle.SymmetricCryptos.StreamCryptos;
using CryptoBase.DataFormatExtensions;
using CryptoBase.SymmetricCryptos.StreamCryptos;

namespace CryptoBase.Tests;

public class ChaCha20Test
{
	/// <summary>
	/// https://tools.ietf.org/html/rfc8439#section-2.4.2
	/// </summary>
	public static readonly TheoryData<string, string, string, string> DataCounter1 = new() { { @"000102030405060708090A0B0C0D0E0F101112131415161718191A1B1C1D1E1F", @"000000000000004A00000000", @"6E2E359A2568F98041BA0728DD0D6981E97E7AEC1D4360C20A27AFCCFD9FAE0BF91B65C5524733AB8F593DABCD62B3571639D624E65152AB8F530C359F0861D807CA0DBF500D6A6156A38E088A22B65E52BC514D16CCF806818CE91AB77937365AF90BBF74A35BE6B40B8EEDF2785E42874D", @"4C616469657320616E642047656E746C656D656E206F662074686520636C617373206F66202739393A204966204920636F756C64206F6666657220796F75206F6E6C79206F6E652074697020666F7220746865206675747572652C2073756E73637265656E20776F756C642062652069742E" } };

	public static readonly TheoryData<string, string, string, string> Data = new() { { @"1C9240A5EB55D38AF333888604F6B5F0473917C1402B80099DCA5CBC207075C0", @"1C000000000000004A000000", @"", @"" } };
	public static readonly TheoryData<string, string, string> Data65536 = new() { { @"0A5DB00356A9FC4FA2F5489BEE4194E73A8DE03386D92C7FD22578CB1E71C417", @"1C9240A5EB55D38AF3338886", @"" } };

	private static void TestCounter1_Internal(SnuffleCryptoBase crypto, string hex, string hex2)
	{
		Assert.Equal(@"ChaCha20", crypto.Name);
		Assert.Equal(12, crypto.IvSize);

		Span<byte> h1 = hex.FromHex();
		Span<byte> h2 = hex2.FromHex();
		Span<byte> i1 = stackalloc byte[255];
		Span<byte> o1 = stackalloc byte[i1.Length];

		h1.CopyTo(i1[64..]);

		crypto.Update(i1, o1);
		Assert.True(o1.Slice(64, 114).SequenceEqual(h2));

		crypto.Reset();

		h1.CopyTo(i1[64..]);

		crypto.Update(i1, o1);
		Assert.True(o1.Slice(64, 114).SequenceEqual(h2));

		crypto.Dispose();
	}

	private static void Test_Internal(SnuffleCryptoBase crypto, string inputHex, string outputHex)
	{
		Assert.Equal(@"ChaCha20", crypto.Name);
		Assert.Equal(12, crypto.IvSize);

		Span<byte> i = inputHex.FromHex();
		Span<byte> o = outputHex.FromHex();
		Span<byte> o1 = stackalloc byte[i.Length];

		crypto.Update(i, o1);
		Assert.True(o1.SequenceEqual(o));

		crypto.Reset();

		crypto.Update(i, o1);
		Assert.True(o1.SequenceEqual(o));

		crypto.Dispose();
	}

	private static void Test65536_Internal(SnuffleCryptoBase crypto, string outputHex)
	{
		Assert.Equal(@"ChaCha20", crypto.Name);
		Assert.Equal(12, crypto.IvSize);

		Span<byte> h = outputHex.FromHex();// 65536

		Span<byte> i = stackalloc byte[512];
		Span<byte> o1 = stackalloc byte[512];

		// 63
		for (int j = 0; j < 1040; j++)
		{
			crypto.Update(i[..63], o1);
			Assert.True(o1[..63].SequenceEqual(h.Slice(63 * j, 63)));
		}

		crypto.Update(i[..63], o1);
		Assert.True(o1[..16].SequenceEqual(h.Slice(63 * 1040, 16)));

		crypto.Reset();

		// 64
		for (int j = 0; j < 1024; j++)
		{
			crypto.Update(i[..64], o1);
			Assert.True(o1[..64].SequenceEqual(h.Slice(64 * j, 64)));
		}

		crypto.Reset();

		// 128
		for (int j = 0; j < 512; j++)
		{
			crypto.Update(i[..128], o1);
			Assert.True(o1[..128].SequenceEqual(h.Slice(128 * j, 128)));
		}

		crypto.Reset();

		// 256
		for (int j = 0; j < 256; j++)
		{
			crypto.Update(i[..256], o1);
			Assert.True(o1[..256].SequenceEqual(h.Slice(256 * j, 256)));
		}

		crypto.Reset();

		// 512
		for (int j = 0; j < 128; j++)
		{
			crypto.Update(i[..512], o1);
			Assert.True(o1[..512].SequenceEqual(h.Slice(512 * j, 512)));
		}

		crypto.Dispose();
	}

	[Theory]
	[MemberData(nameof(DataCounter1), MemberType = typeof(ChaCha20Test))]
	public void TestCounter1(string keyHex, string ivHex, string hex, string hex2)
	{
		byte[] key = keyHex.FromHex();
		byte[] iv = ivHex.FromHex();
		TestCounter1_Internal(new BcChaCha20Crypto(key, iv), hex, hex2);
		TestCounter1_Internal(new ChaCha20Crypto(key, iv), hex, hex2);
	}

	[Theory]
	[MemberData(nameof(Data), MemberType = typeof(ChaCha20Test))]
	public void Test(string keyHex, string ivHex, string hex, string hex2)
	{
		byte[] key = keyHex.FromHex();
		byte[] iv = ivHex.FromHex();
		Test_Internal(new BcChaCha20Crypto(key, iv), hex, hex2);
		Test_Internal(new ChaCha20Crypto(key, iv), hex, hex2);
	}

	[Theory]
	[MemberData(nameof(Data65536), MemberType = typeof(ChaCha20Test))]
	public void Test65536(string keyHex, string ivHex, string hex)
	{
		byte[] key = keyHex.FromHex();
		byte[] iv = ivHex.FromHex();
		Test65536_Internal(new BcChaCha20Crypto(key, iv), hex);
		Test65536_Internal(new ChaCha20Crypto(key, iv), hex);
	}
}
